import ExpenseItem from "./components/ExpenseItem";
import Expenses from "./components/Expenses"
function App(props) {

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses title={props.expenses[0].title} amount={props.expenses[0].amount} date={props.expenses[0].date} />
      <Expenses title={props.expenses[1].title} amount={props.expenses[1].amount} date={props.expenses[1].date} />
      <Expenses title={props.expenses[2].title} amount={props.expenses[2].amount} date={props.expenses[2].date} />
      <Expenses title={props.expenses[3].title} amount={props.expenses[3].amount} date={props.expenses[3].date} />
    </div>
  );
}

export default App;
